    //     item.country.toLowerCase().includes(searchText.toLowerCase())
    // );


  return (
    <div>
        <AdminNav/>
        <div className="container mt-5">

        <input
                type="search"
                placeholder="Search..."
                value={searchQuery}
                onChange={handleSearch}
                name='search'
            />

        <DataTable
            title="Owner Contact Details"
            columns={columns}
            data={records}
            fixedHeader
            pagination
        />
        </div>
    </div>
  )
}

export default OwnerContacts
